import React, { Component } from 'react';

class VideoPlayer extends Component {
    render() {
        return (
            <div>
                <div className="ml-3 mt-4">
                    <iframe width="1000" height="590" className="rounded" title="Title" src={"https://www.youtube.com/embed/6BYIKEH0RCQ?autoplay=1"} allow='autoplay;'>
                    </iframe>
                </div>
            </div>
        )
    }
}

export default VideoPlayer;
